import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/MapView.css";

const bossImg = "https://www.shutterstock.com/image-vector/river-mountains-top-view-landscape-260nw-2137764849.jpg";
const levels = [
  { id: 1, name: "Level 1" },
  { id: 2, name: "Level 2" },
  { id: 3, name: "Level 3" },
  { id: 4, name: "Level 4" },
  { id: 5, name: "Grammowl" },
];

export default function JungleLush() {
  const navigate = useNavigate();
  // For demo: only first level unlocked
  const [unlocked, setUnlocked] = useState(1);

  return (
    <div className="junglelush-bg" style={{ backgroundImage: `url(${bossImg})` }}>
      <div className="jl-bg-overlay">
        <h1 className="jl-header">Grammowls Jungle</h1>
        <div className="jl-levels-row">
          {levels.map((level, idx) => (
            <button
              key={level.id}
              className={`jl-level-btn${idx + 1 <= unlocked ? "" : " locked"}${level.id === 5 ? " boss" : ""}`}
              disabled={idx + 1 > unlocked}
              onClick={() => alert(`Go to ${level.name}`)}
              style={level.id === 5 ? { backgroundImage: `url(${bossImg})` } : {}}
              title={level.name}
            >
              {level.id === 5 ? (
                <span className="jl-boss-label">ðŸ‘¹<br />{level.name}</span>
              ) : (
                <span>{level.name}</span>
              )}
              {idx + 1 > unlocked && <span className="jl-lock">ðŸ”’</span>}
            </button>
          ))}
        </div>
        <button className="jl-return-btn" onClick={() => navigate("/map")}>Return to Vocabia Map</button>
      </div>
    </div>
  );
}
